import Navbar from "../components/Navbar";
import "../styles/landingPage.css";
function LandingPage() {
  return (
    <>
      <Navbar />
      <div className="lpBg">
        <div className="lpleft"></div>
      </div>
    </>
  );
}

export default LandingPage;
